import React from "react";
import {
    withScriptjs,
    withGoogleMap,
    GoogleMap,
    Marker
} from "react-google-maps";

const Map = withScriptjs(
    withGoogleMap(props => (
        <GoogleMap
            defaultZoom={8}
            defaultCenter={{ lat: -34.397, lng: 150.644 }}
            onClick={props.handleClickedMap}
        >
            {props.markers[0].latitude}
            {props.isMarkerShown &&
                props.markers.map((marker, i) => (
                    <Marker
                        position={{ lat: marker[i].latitude, lng: marker[i].longtitude }}
                    />
                ))}
        </GoogleMap>
    ))
);

export default Map;
